import React from "react";

const AboutPage = () => {
	return (
		<main className="relative flex justify-around items-center w-full h-[82vh] px-28  text-lg text-gray-600 ">
			<div className="bg-white">
				<div>
					Tech Personality: I'm passionate about Technology and I love creating
					amazing websites/web Apps with good and wonderful User Experience. I
					have a dynamic and progressive personality, I'm open to learning as
					much as practically possible to increase my skill level and I'm
					forever open to work with good Team of developers all over the world
					in order to make a positive impact on the world.
				</div>
				<div>
					Hobbies: Aside from writing codes, I also enjoy graphic designing, I'm
					a football lover and I just don't watch it, I play it. Before I forget
					I love music and just like football I listen, I sing and I play Piano
					too.
				</div>
			</div>
		</main>
	);
};

export default AboutPage;
